import React from "react";
import Column from "../../components/column";
import HeaderTable from "../../components/headerTable";
import "../index.css"

const Table = ({ columns }) => {
    return (
        <div className="table">
            <HeaderTable
                code={
                    "for (let i = 0; i < 10; i++) {\n" +
                    "console.log(i)\n" +
                    "}"
                }
                number={1}
            />
            <div className="cells">
                {
                    columns.map((column, index) => {
                        return (
                            <Column column={column} key={index}/>
                        )
                    })
                }
            </div>
        </div>
    )
}

export default Table;
